import React from 'react'

const TrendingCoin = ({ coin }) => {
    return (
        <div className='px-2 w-1/2 bg-red-500'>
            <div className='bg-white rounded-lg flex flex-col border p-'>
                <img className='w-14 my-4' src={coin.large} alt='logo'/>
                <div className='font-semibold text-lg'>{coin.name}</div>
            </div>
        </div>
    )
}

const TrendingCoinList = ({ TrendingJSON }) => {
    var arrTrending = []
    TrendingJSON.forEach((coin) => {
        arrTrending.push(<TrendingCoin coin={coin} key={coin.id}/>)
    })
    return (
        <div>
            <div className='font-bold text-2xl'>Trending Coins</div>
            <div className='flex flex-wrap w-full'>
                {arrTrending}
            </div>
        </div>
    )
}

const Home = ({ TrendingJSON }) => {
    return (
        <div className='h-screen'>
            <TrendingCoinList TrendingJSON={TrendingJSON}/>
        </div>
    )
}

export default Home
